import React from 'react';
import headerLogo from '../images/Logo.svg';

function Header() {
  return (
    <div className="header">
        <img className="header__logo" src={headerLogo} id="headerLogo" alt="Logo Alrededor De USA" />
    </div>
  );
}

export default Header;
